// src/api.js

import axios from 'axios';
import { csrftoken } from './csrfToken';

const api = axios.create({
  baseURL: 'http://localhost:8001',  // Your Django server URL
  withCredentials: true,
  headers: {
    'X-CSRFToken': csrftoken
  }
});

export default api;
